        methods: {
               handleCommand() {
                this.$router.push('/Register');
                 },
                 register()
                 {
                    this.$router.push('/Register');
                 },
              handleLogin2(word) {
                let that = this;
                 console.log("ddd");
                this.$refs.AccountFrom2.validate((valid) => {
                  if (valid) {
                    this.loading2 = true;
                    let loginParams = {username: this.account2.rootusername, pwd: this.account2.rootpwd,state:word};
                    console.log(loginParams);
                    //相当于一个json对象
                    API.login(loginParams).then(function (result) {
                      that.loading2 = false;
                        
                      if (result && result.username) {
                    
                        localStorage.setItem('access-user', JSON.stringify(result));
                        console.log(JSON.stringify(result));
                          that.$router.push({path: '/Home'});
                      } else {
                        that.$message.error({showClose: true, message: result.errmsg || '登录失败', duration: 2000});
                      }
                    }, function (err) {
                      that.loading2 = false;
                      that.$message.error({showClose: true, message: err.toString(), duration: 2000});
                    }).catch(function (error) {
                      that.loading2 = false;
                      console.log(error);
                      that.$message.error({showClose: true, message: '请求出现异常', duration: 2000});
                    });
                  }
                });
              },
              handleLogin(word) {
                let that = this;
                this.$refs.AccountFrom.validate((valid) => {
                  if (valid) {
                    this.loading = true;
                    let loginParams = {username: this.account.username, pwd: this.account.pwd,state:word};
                
                    //相当于一个json对象
                    API.login(loginParams).then(function (result) {
                      that.loading = false;
                        
                      if (result && result.username) {
                    
                        localStorage.setItem('access-user', JSON.stringify(result));
                        console.log(JSON.stringify(result));
                          that.$router.push({path: '/Home'});
                      } else {
                        that.$message.error({showClose: true, message: result.errmsg || '登录失败', duration: 2000});
                      }
                    }, function (err) {
                      that.loading = false;
                      that.$message.error({showClose: true, message: err.toString(), duration: 2000});
